import React from 'react'
import './ButtonTop.css'
import { Link } from 'react-router-dom'

export default function ButtonTop() {
  return (
    <>
    <button><Link to='#'></Link> <i class="fa-sharp fa-solid fa-arrow-up"></i></button>
    </>
  )
}
